import { SearchOutlined } from "@ant-design/icons/lib/icons";
import { Col, DatePicker, Row } from "antd";
import React from "react";
function Dashboard() {
  const { RangePicker } = DatePicker;

  const onChangeRangePicker = (dates, dateStrings) => {
    console.log(dates, dateStrings);
  };
  return (
    <div className="dashboard">
      <div className="date-picker-place">
        <Row>
          <Col span={8} className="col-date-picker-place">
            From Date to Date:
            <RangePicker onChange={onChangeRangePicker} format="DD-MM-YYYY" />
          </Col>
          <Col span={8} className="col-date-picker-place">
            <span>
              <SearchOutlined spin/> Search something
            </span>
          </Col>
          <Col span={8} className="col-date-picker-place">
            3
          </Col>
        </Row>
      </div>
    </div>
  );
}
export default Dashboard;
